import React from 'react';
import '../../App.css';

function TodoApp() {
    return (
        <div >
            <LoginComponent/>
        </div>

    )
}

function LoginComponent() {
    return (
        <div>
            User Name: <input type="text" name="username"></input><br/>
            Password: <input type="password" name="password"></input><br/>
            <button>Login</button>
        </div>
    )
}

export default TodoApp;
